import 'package:flutter/material.dart';
class statefull extends StatefulWidget {
  const statefull({super.key});
  @override
  State<statefull> createState() => _statefullState();
}
class _statefullState extends State<statefull> {
  var li=["data:image/jpeg;base64,",
    "data:image/png;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSMDbZAp24rvIfLSDY9al2syh4lK9ZBib4WHg&usqp=CAU",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRlzxpPO3onVQ2ZgZhlpfgTHz_YYT__zesbLQ&usqp=CAU",
  ];
  int x=0;
  void inc() {
    if (x == 0) {
      x = li.length - 1;
    }
    else {
      x--;
    }
  }
  void dec(){
    if(x==li.length-1){
      x=0;
    }
    else{
      x++;
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text("About"),
        centerTitle: true,
      ),
      body: Center(
        child: Column(
          children: [
            Text("to-do list applications is one of the interesting app\nfor better planning and execution of activities. Students have multiple tasks to handle and many due dates to remember.\n"),
            Padding(
              padding: const EdgeInsets.all(20),
              child: Container(
                height: 354,
                width: 358,
                decoration: BoxDecoration(
                  image: DecorationImage(
                      fit: BoxFit.fill,
                      image: NetworkImage(li[x])),
                ),
              ),
            ),
            Center(
              child: Row(
                mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                children: [
                  Padding(
                    padding: const EdgeInsets.all(8.0),
                    child: IconButton(onPressed: (){
                      setState(() {
                        dec();
                      });

                    }, icon:Icon(Icons.arrow_back_ios_new)),
                  ),
                  Padding(
                    padding: const EdgeInsets.all(8.0),
                    child: IconButton(onPressed: (){
                      setState(() {
                        inc();
                      });
                    }, icon: Icon(Icons.arrow_forward_ios_outlined)),
                  ),
                ],
              ),
            ),
          ],
        ),
      ),
    );
  }
}

